import React from 'react';
import {Navbar, Nav} from 'react-bootstrap';
import logo from "../static/produitsLogo.png"
import "../App.css";
import {
  CDBSidebar,
  CDBSidebarHeader,
  CDBSidebarMenuItem,
  CDBSidebarContent,
  CDBSidebarMenu,
  CDBSidebarSubMenu,
  CDBSidebarFooter,
} from 'cdbreact';

const Navigation = () => {
  return (
    <div>
    <Navbar bg="dark" variant="dark" expand= "lg">
      <Navbar.Brand className="app-logo" href="/">
        <img
          src={logo}
          width="40"
          height="50"
          className="d-inline-block align-center"
          alt="Application de Gestion De Produits"
        />{' '}
        Application De Gestion De Produits
      </Navbar.Brand>
    </Navbar>

    <div>
    <CDBSidebar backgroundColor="#ffa726">
        <CDBSidebarHeader prefix={<i className="fa fa-bars" />}>Navigation</CDBSidebarHeader>
        <CDBSidebarContent>
          <CDBSidebarMenu>
            <CDBSidebarMenuItem icon="home">Accueil</CDBSidebarMenuItem>
            <CDBSidebarMenuItem icon="list">Liste Des Produits</CDBSidebarMenuItem>
            <CDBSidebarMenuItem icon="user" iconType="solid">
              Gestion Des Produits
            </CDBSidebarMenuItem>
          </CDBSidebarMenu>
        </CDBSidebarContent>
      </CDBSidebar>
    </div>
   </div>
  );
};

export default Navigation;
